import {TopBar} from "./App";
import Alert from '@mui/material/Alert';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import  './questionnaire.css';
import {Card, Form} from "react-bootstrap";
import {useState} from "react";

function displayFileName() {
    var file = document.getElementById('videoInput').files[0]; // 获取选中的文件
    var fileNameDisplay = document.getElementById('fileNameDisplay'); // 获取展示文件名的元素

    if (file) {
        fileNameDisplay.textContent = file.name; // 显示文件名
    } else {
        fileNameDisplay.textContent = ""; // 如果没有文件被选中，则不显示任何内容
    }
}


const Questionnaire = () => {
    const [alertVisible, setAlertVisible] = useState(true);
    const [fileName, setFileName] = useState("");

    const VisuallyHiddenInput = styled('input')({
        clip: 'rect(0 0 0 0)',
        clipPath: 'inset(50%)',
        height: 1,
        overflow: 'hidden',
        position: 'absolute',
        bottom: 0,
        left: 0,
        whiteSpace: 'nowrap',
        width: 1,
});


  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      setFileName(file.name);
    }
  };



  return (
      <>
          <TopBar/>
          <Stack sx={{ width: '100%' }} spacing={5}>
              {alertVisible &&(
              <Alert severity="warning"
                     onClose={() => {setAlertVisible(false)}}>
                  We are not able to collect your private information, these questions just help us to better analyse the results.</Alert>
                  )}

          </Stack>
          <Card>
              <Card.Header>Questionnaire</Card.Header>
              <Card.Body>
                  <blockquote className="blockquote mb-0">
                      <p>
                          {' '}
                          Please complete the following Questionnaire
                      </p>
                      <footer className="blockquote-footer">
                          <p> 1. What is your biological gender?</p>
                          <Form>
                              {['radio'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          name={"gender"}
                                          id={"female"}
                                          label={"Female"}
                                      />
                                      <Form.Check
                                          type={type}
                                          name={"gender"}
                                          label={`Male`}
                                          id={"male"}
                                      />
                                       <Form.Check
                                          type={type}
                                           name={"gender"}
                                          label={`Perfer not to say`}
                                          id={"pns"}
                                      />
                                  </div>
                              ))}
                          </Form>
                           <p> 2. What is your age?</p>
                          <Form>
                              {['radio'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          name={"age"}
                                          id={"u35"}
                                          label={"Under 35"}
                                      />
                                      <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`35 - 60`}
                                          id={"35to60"}
                                      />
                                       <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`Up to 60`}
                                          id={"u60"}
                                      />
                                       <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`Perfer not to say`}
                                          id={"pnsa"}
                                      />
                                  </div>
                              ))}
                          </Form>
                          <p>3. Please upload your video here.
                              <Button component="label">Upload Video<VisuallyHiddenInput type="file" onChange={handleFileChange}/>
                              </Button>
                          </p>
                          <div className={"button"}>
                              <Button variant="outlined"> Submit </Button>
                          </div>
                      </footer>
                  </blockquote>
              </Card.Body>
          </Card>
      </>
  );}
export default Questionnaire;
